import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');
    const [isLoading, setIsLoading] = useState(false);

    const handleLogin = async (e) => {
        e.preventDefault();
        setIsLoading(true);
        setError('');

        try {
            const response = await fetch('/api/users/login', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ email, password }),
            });

            const data = await response.json();

            if (!response.ok) {
                throw new Error(data.message || 'Login failed');
            }

            // Store the token
            localStorage.setItem('userToken', data.token);

            // Navigate based on whether preferences exist
            if (data.hasPreferences) {
                navigate('/practice');
            } else {
                navigate('/questionnaire');
            }
        } catch (err) {
            setError(err.message || 'Failed to login');
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="home-container">
            <div className="home-content">
                <div className="left-section">
                    <h1>Welcome to YogaAI</h1>
                    <p className="tagline">Your Personal AI Yoga Assistant</p>
                    <div className="features">
                        <div className="feature-item">
                            <i className="fas fa-robot"></i>
                            <h3>AI-Powered Guidance</h3>
                            <p>Real-time pose correction and feedback</p>
                        </div>
                        <div className="feature-item">
                            <i className="fas fa-chart-line"></i>
                            <h3>Track Progress</h3>
                            <p>Monitor your improvement over time</p>
                        </div>
                        <div className="feature-item">
                            <i className="fas fa-user-friends"></i>
                            <h3>Personalized Experience</h3>
                            <p>Tailored to your skill level and goals</p>
                        </div>
                    </div>
                    <button
                        className="get-started-button"
                        onClick={() => navigate('/signup')}
                    >
                        Get Started
                    </button>
                </div>

                <div className="right-section">
                    <div className="login-box">
                        <h2>Welcome Back</h2>
                        <form onSubmit={handleLogin}>
                            {error && <div className="error-message">{error}</div>}
                            <div className="form-group">
                                <label htmlFor="email">Email</label>
                                <input
                                    type="email"
                                    id="email"
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <label htmlFor="password">Password</label>
                                <input
                                    type="password"
                                    id="password"
                                    value={password}
                                    onChange={(e) => setPassword(e.target.value)}
                                    required
                                />
                            </div>
                            <button
                                type="submit"
                                className="login-button"
                                disabled={isLoading}
                            >
                                {isLoading ? 'Logging in...' : 'Login'}
                            </button>
                        </form>
                        <p className="signup-prompt">
                            Don't have an account?{' '}
                            <button
                                className="text-button"
                                onClick={() => navigate('/signup')}
                            >
                                Sign up
                            </button>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
